import React, { useEffect, useState } from 'react';

function User(){

    const token_access = localStorage.getItem('access');


    useEffect(() => {

        fetch(
            'myprofile/', 
            {
                headers: {
                    'Authorization' : `Bearer ${token_access}`,
                }
            }
        )

    });

    return(

        <div>
            <h1>username</h1>
        </div>
    );


}

export default User;
